comments.body:
This PR will allow patrons to request items from resource sharing. 
@carolyncole @maxkadel a heads up that availability status fails to display in this record which means: no status in the record page. Event though the location we are seeing (Firestone Library - Stacks ) in the record page is the desired one, it displays because it's the fall back look up to [Bibdata](https://bibdata.princeton.edu/locations/holding_locations.json) when the JS availability response is failing. 

I will work on a separate PR to update availability status and make sure that the location display in the record page is the permanent location.
